import{_ as t,c as a,o,ah as l}from"./chunks/framework.PvdZnrZd.js";const u=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"zenith/featured-app/Seller Add-Ons/SOCIAL NETWORK TABS.md","filePath":"zenith/featured-app/Seller Add-Ons/SOCIAL NETWORK TABS.md"}'),r={name:"zenith/featured-app/Seller Add-Ons/SOCIAL NETWORK TABS.md"};function i(n,e,s,p,c,h){return o(),a("div",null,[...e[0]||(e[0]=[l('<p><strong>THIS APP IS CURRENTLY DEPRECIATED</strong></p><p>With the help of the <a href="https://webkul.com/blog/shopify-multivendor-marketplace-new-theme-launched/" target="_blank" rel="noreferrer"><strong>Multivendor Marketplace app for Shopify</strong></a><strong>- Social Network tabs</strong> feature app,</p><p>Admin can enable his/her sellers to connect their seller profile page with their own social media platforms like Facebook, Instagram, Digg, Flickr, Vimeo, etc.</p><p>This feature will have an additional cost of USD 5 per month which is over and above your current Multivendor Marketplace plan.</p><h3 id="features" tabindex="-1">FEATURES <a class="header-anchor" href="#features" aria-label="Permalink to &quot;FEATURES&quot;">​</a></h3><ul><li>Admin can configure the social network tabs that he/she wants to display to sellers.</li><li>Sellers can choose from the social network tabs that admin has made available to them.</li><li>Sellers can connect their seller profile page with their own social media platforms.</li><li>Customers can gather information regarding sellers by visiting their social media platforms.</li></ul><p>So, Let&#39;s understand the workflow of the Multi-vendor Marketplace Social Network Tabs:-</p><h3 id="multi-vendor-marketplace-social-network-tabs-admin-panel" tabindex="-1">Multi-vendor Marketplace Social Network Tabs-ADMIN PANEL <a class="header-anchor" href="#multi-vendor-marketplace-social-network-tabs-admin-panel" aria-label="Permalink to &quot;Multi-vendor Marketplace Social Network Tabs-ADMIN PANEL&quot;">​</a></h3><p>Firstly visit &quot;Feature Apps&quot; section by clicking on (...) three dots on the top right-hand side of the main menu of the Multivendor Marketplace app:-</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/10/5.png" alt="Multivendor"></p><p>Now go to &quot;Marketplace Seller Add-ons&quot; and enable &quot;Social Network Tabs&quot; feature app:-</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/10/6.png" alt="12"></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/10/7.png" alt="23"></p><h3 id="social-network-tabs" tabindex="-1">SOCIAL NETWORK TABS <a class="header-anchor" href="#social-network-tabs" aria-label="Permalink to &quot;SOCIAL NETWORK TABS&quot;">​</a></h3><p>Now admin needs to visit the &quot;Social Network tabs&quot; section from the &quot;Sellers&quot; menu in the app</p><p>And from here choose the social media platforms that you want to display to your sellers on their respective seller panels.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/10/8.png" alt="1"></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/10/9.png" alt="34"></p><h3 id="social-network-tab-settings" tabindex="-1">SOCIAL NETWORK TAB SETTINGS <a class="header-anchor" href="#social-network-tab-settings" aria-label="Permalink to &quot;SOCIAL NETWORK TAB SETTINGS&quot;">​</a></h3><p>From here admin can configure the display look and styling of social media tabs that will be shown on frontend on the seller profile page:-</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/10/10.png" alt=" Multi-vendor Social Network Tabs"></p><h3 id="display-setting" tabindex="-1"><strong>Display Setting:-</strong> <a class="header-anchor" href="#display-setting" aria-label="Permalink to &quot;**Display Setting:-**&quot;">​</a></h3><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/10/11.png" alt=" Multi-vendor Social Network Tabs"></p><h3 id="style-setting" tabindex="-1"><strong>Style Setting:-</strong> <a class="header-anchor" href="#style-setting" aria-label="Permalink to &quot;**Style Setting:-**&quot;">​</a></h3><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/10/12.png" alt=" Multi-vendor Social Network Tabs"></p><h3 id="seller-panel" tabindex="-1">SELLER PANEL <a class="header-anchor" href="#seller-panel" aria-label="Permalink to &quot;SELLER PANEL&quot;">​</a></h3><p>Sellers can only be able the view those social network tabs which have made available to them by admin.</p><p>Now seller needs to visit the &quot;Social Network tabs&quot; section in the &quot;Profile&quot; menu from their respective seller panel.</p><h3 id="social-network-tabs-1" tabindex="-1">SOCIAL NETWORK TABS <a class="header-anchor" href="#social-network-tabs-1" aria-label="Permalink to &quot;SOCIAL NETWORK TABS&quot;">​</a></h3><p>Here sellers can configure social network tabs to display them on their seller profile page.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/10/13.png" alt=" Multi-vendor Social Network Tabs"></p><h3 id="frontend" tabindex="-1">FRONTEND <a class="header-anchor" href="#frontend" aria-label="Permalink to &quot;FRONTEND&quot;">​</a></h3><p>Once the configuration is done then Social network tabs will be visible on seller profile page like showing in below screenshot:-</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/10/seller_profile___demo_store__1_.png" alt=" Multi-vendor Social Network Tabs"></p><p>Clicking the <strong>Twitter Tab</strong>, the Twitter posts will appear like this on the seller profile page:-</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/10/seller_profile___demo_store.png" alt="seller profile page"></p><p>Similarly, you can click the rest of the tabs to display social media posts on the seller profile page.</p><h3 id="social-network-tabs-demo" tabindex="-1">Social Network Tabs DEMO <a class="header-anchor" href="#social-network-tabs-demo" aria-label="Permalink to &quot;Social Network Tabs DEMO&quot;">​</a></h3><p>Check out Multi-vendor Marketplace Social Network Tabs Demo: <a href="https://multivendor-marketplace-5.myshopify.com" target="_blank" rel="noreferrer">https://multivendor-marketplace-5.myshopify.com</a></p>',39)])])}const b=t(r,[["render",i]]);export{u as __pageData,b as default};
